import React from "react";
import "./MessageBubble.css";

const MessageBubble = ({ sender, text }) => {
  const isUser = sender === "user";
  return (
    <div className={`message-bubble ${isUser ? "user" : "bot"}`}>
      {text}
    </div>
  );
};

export default MessageBubble;
